window.bookSummaryJSON = "<p><b>He's going to take me the same way they took our planet. Without gentleness or remorse.</b></p> <p>I dared to defy him, but as this alien brute rips my clothes off and mounts me with my bottom still burning from his punishing hand it is clear what is in store for me isn't mere vengeance.</p> <p>It is conquest.</p> <p>Soon I will know what it means to be utterly and shamefully broken, my helpless body ravaged and plundered in every way imaginable, and when he is done I won't just be sore and spent.</p> <p>I will be his.</p> <p><b>Publisher's Note</b>: <i>Alien Conqueror</i> includes spankings, rough, intense sexual scenes, and strong D/s themes. If such material offends you, please don't buy this book.</p>"; 
